script: |
  super -f text -I q600.spq | sort > q600.out

inputs:
  - name: q600.spq
    data: |
      SELECT - - cor1.col1 + ( - cor1.col2 ) * cor1.col1 / - cor1.col1 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q600.out
    data: |
      55
      55
      55
      58
      58
      58
      85
      85
      85
